import './App.css';
import React from 'react';

import CityAPI from './components/cityAPI';
import ForecastAPI from './components/forecastAPI';


import { Nav, Navbar } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css'

import { BrowserRouter as Router, Route, Switch } from "react-router-dom";

function App() {
  
  return (
    
    <>
    <Navbar className="navtop" bg="dark" variant="dark">
      
      <Navbar.Brand className="title" href="/">Weather App</Navbar.Brand>
      <Nav className="me-auto">
        <Nav.Link className="menu" href="/">Home</Nav.Link>
        <Nav.Link className="menu" href="/forecast">Forecast</Nav.Link>
        <Nav.Link className="menu" href="#pricing">Data</Nav.Link>
      </Nav>
     
    </Navbar>
    
    
      <div className="app">
      <Router>
        <Route path='/' component={CityAPI} />
        <Route path='/forecast' component={ForecastAPI} />
        {/* <CityAPI></CityAPI> */}
      </Router>
  
      </div>
      </>
  );
}

export default App;
